import React, { useState, useEffect } from 'react';

function Results() {
    const [results, setResults] = useState([]);

    useEffect(() => {
        fetch('/api/results')
        .then(response => response.json())
        .then(data => {
        console.log(data);
        setResults(data);
        });
       }, []);       

       return (
        <table>
        <thead>
        <tr>
        <th>ID</th>
        <th>Link</th>
        <th>Result 1</th>
        <th>Result 2</th>
        <th>Result 3</th>
        </tr>
        </thead>
        <tbody>
        {console.log(results)}
        {results.map(result => (
            <tr key={result.id}>
            <td>{result.id}</td>
            <td>{result.link}</td>
            <td>{result.result1}</td>
            <td>{result.result2}</td>
            <td>{result.result3}</td>
            </tr>
        ))}
        </tbody>
        </table>
        );

}

export default Results;
